def minon_game(s):
    # stuart scores
    vowels = 'AEIOU'
    len_s = len(s)
    lis_stuart = []
    lis_kevin = []
    for i in range(len(s)):
        for j in range(i+1, len(s) + 1):
            if s[i] in vowels:
                lis_kevin.append(s[i:j])
            else:
                lis_stuart.append(s[i:j])
    lis_stuart = set(lis_stuart)
    lis_kevin = set(lis_kevin)
    occur_lis = []
    for i in lis_stuart:
        occur = 0
        ind_1 = 0
        len_i = len(i)
        ind_2 = len_i
        len_loop = len_s - len_i
        for j in range(len_loop + 1):
            if i == s[ind_1:ind_2]:
                occur = occur + 1
            ind_1 = ind_1 + 1
            ind_2 = ind_2 + 1
        occur_lis.append(occur)
    stuart_score = sum(occur_lis)
    # kevin scores
    occur_lis = []
    for i in lis_kevin:
        occur = 0
        ind_1 = 0
        len_i = len(i)
        ind_2 = len_i
        len_loop = len_s - len_i
        for j in range(len_loop + 1):
            if i == s[ind_1:ind_2]:
                occur = occur + 1
            ind_1 = ind_1 + 1
            ind_2 = ind_2 + 1
        occur_lis.append(occur)
    kevin_score = sum(occur_lis)
    if stuart_score > kevin_score:
        print('stuart', stuart_score)
    elif stuart_score == kevin_score:
        print('Draw')
    else:
        print('kevin', kevin_score)
print(minon_game(''))